import React from "react";
import "./styles.css";

function Footer() {
  return (
    <div style={{ marginTop: "20%" }} className="Footer">
      <div
        style={{
          width: "150px",
          height: "150px",
          justifyContent: "space-around",
          alignItems: "center",
          display: "flex",
          flexDirection: "column",
        }}
      >
        <img
          alt="school logo"
          src={require("../Icons/logo white.png")}
          style={{ maxWidth: "100%", maxHeight: "100%" }}
        />
      </div>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          alignItems: "flex-end",
          justifyContent: "space-around",
        }}
      >
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            alignItems: "flex-end",
            justifyContent: "center",
          }}
        >
          <span style={{ fontSize: "30px" }} className="DevanshiBipinGanatra">
            Devanshi Bipin Ganatra
          </span>
          <span style={{ fontSize: "20px" }} className="FullStackEngineer">
            FULL STACK ENGINEER
          </span>
        </div>
        <div style={{ marginTop: "10%" }}>
          <span>Find me on:</span>
          <div style={{display:"flex", flexDirection: "row", alignItems:"flex-end", justifyContent:"center"}}>
            <div style={{ width: "50px", height: "50px" }}>
              <a href="">
                <img
                  alt="LinkedInIcon"
                  src={require("../Icons/Icons-16.png")}
                  style={{ maxWidth: "100%", maxHeight: "100%"}}
                />
              </a>
            </div>
            <div style={{ width: "50px", height: "50px" }}>
              <a href="">
                <img
                  alt="GitIcon"
                  src={require("../Icons/Icons-17.png")}
                  style={{ maxWidth: "100%", maxHeight: "100%", marginLeft:"3%"}}
                />
              </a>
            </div>
            <div style={{ width: "50px", height: "50px" }}>
              <a href="">
                <img
                  alt="FacebookIcon"
                  src={require("../Icons/Icons-18.png")}
                  style={{ maxWidth: "100%", maxHeight: "100%", marginLeft:"10%"}}
                />
              </a>
            </div>
            <div style={{ width: "50px", height: "50px" }}>
              <a href="">
                <img
                  alt="InstagramIcon"
                  src={require("../Icons/Icons-19.png")}
                  style={{ maxWidth: "100%", maxHeight: "100%", marginLeft:"10%"}}
                />
              </a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Footer;
